import { Box, Drawer, makeStyles, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography } from "@material-ui/core";
import { Rowing } from "@material-ui/icons";

const drawerWidthRight = 280

const useStyles = makeStyles((theme) =>{
    return{
        root:{
            
        },
        navRight:{
            width: drawerWidthRight,
            //display:'none'
        },
        drawerPaperRight:{
            width : drawerWidthRight,
            backgroundColor:"#FFFFF",
            borderLeft:'0px'

        },

}})

const ServerColumns = [
    { prod: 'SW11203', hProd: 'SW11213', dev: "SW11003" }
  ];

  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }
  
  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];
  

const RightNav = () => {
    const classes = useStyles()
    return ( 
        <div>
            
            <Drawer
            elevation={0}
            variant = "permanent"
            anchor = 'right'
            classes = {{paper : classes.drawerPaperRight}}
            className={classes.navRight}
            >                
                <Box>
                    <Box m={2} display="flex" justifyContent="center">
                        <Typography gutterBottom>
                            Informations                                      
                        </Typography>
                    </Box>
                    
                    <Box>
                        <TableContainer>
                            <Table size="small">
                                <TableHead  >
                                    <TableRow >
                                        <TableCell size="small">Prod</TableCell>
                                        <TableCell size="small">h-Prod</TableCell>
                                        <TableCell size="small">DEV</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                {rows.map((row) => (
                                    <TableRow key={row.name}>
                                    <TableCell component="th" scope="row">
                                        {row.name}
                                    </TableCell>
                                    <TableCell align="right">{row.calories}</TableCell>
                                    <TableCell align="right">{row.fat}</TableCell>
                                    </TableRow>
                                ))}
                                </TableBody>
                            </Table>
                        </TableContainer>
                    </Box>
                </Box>
            </Drawer>
        
        </div> 
     );
}
 
export default RightNav
